import{_ as e,a,b as o,c as i,d as l,e as d,f as n,g as s,h as p,i as m,j as c,k as h,l as u,m as f,n as g,o as _,p as b,q as C,r as k}from"./chunks/qgc_airframe_generic_quadx.xZqrVJYX.js";import{_ as v,c as A,a8 as S,j as t,a as y,o as P}from"./chunks/framework.BDnHobkS.js";const G=JSON.parse('{"title":"DJI FlameWheel 450 + CUAV V5 nano 조립","description":"","frontmatter":{},"headers":[],"relativePath":"ko/frames_multicopter/dji_f450_cuav_5nano.md","filePath":"ko/frames_multicopter/dji_f450_cuav_5nano.md"}'),w={name:"ko/frames_multicopter/dji_f450_cuav_5nano.md"};function F(x,r,V,D,T,q){return P(),A("div",null,r[0]||(r[0]=[S('<h1 id="dji-flamewheel-450-cuav-v5-nano-조립" tabindex="-1">DJI FlameWheel 450 + CUAV V5 nano 조립 <a class="header-anchor" href="#dji-flamewheel-450-cuav-v5-nano-조립" aria-label="Permalink to &quot;DJI FlameWheel 450 + CUAV V5 nano 조립&quot;">​</a></h1><p>This topic provides full instructions for building the kit and configuring PX4 using <em>QGroundControl</em>.</p><p>주요 정보</p><ul><li><strong>Frame:</strong> DJI F450</li><li><strong>Flight controller:</strong> <a href="./../flight_controller/cuav_v5_nano.html">CUAV V5 nano</a></li><li><strong>Assembly time (approx.):</strong> 90 minutes (45 minutes for frame, 45 minutes autopilot installation/configuration)</li></ul><p><img src="'+e+'" alt="Finished setup"></p><h2 id="부품-명세서" tabindex="-1">부품 명세서 <a class="header-anchor" href="#부품-명세서" aria-label="Permalink to &quot;부품 명세서&quot;">​</a></h2><p>조립에 필요한 부품들입니다.</p><ul><li>Flight controller: <a href="https://store.cuav.net/shop/v5-nano/" target="_blank" rel="noreferrer">CUAV V5 nano</a>: <ul><li>GPS: <a href="https://store.cuav.net/index.php?id_product=97&amp;id_product_attribute=0&amp;rewrite=cuav-new-ublox-neo-m8n-gps-module-with-shell-stand-holder-for-flight-controller-gps-compass-for-pixhack-v5-plus-rc-parts-px4&amp;controller=product&amp;id_lang=1" target="_blank" rel="noreferrer">CUAV NEO V2 GPS</a></li><li>전원 모듈</li></ul></li><li>Frame: <a href="https://www.amazon.com/Flame-Wheel-Basic-Quadcopter-Drone/dp/B00HNMVQHY" target="_blank" rel="noreferrer">DJI F450</a></li><li>Propellers: <a href="https://www.masterairscrew.com/products/dji-phantom-built-in-nut-upgrade-propellers-in-black-mr-9-4x5-prop-set-x4-phantom" target="_blank" rel="noreferrer">DJI Phantom Built-in Nut Upgrade Propellers 9.4x5</a></li><li>Battery: <a href="https://hobbyking.com/en_us/turnigy-high-capacity-5200mah-3s-12c-multi-rotor-lipo-pack-w-xt60.html?___store=en_us" target="_blank" rel="noreferrer">Turnigy High Capacity 5200mAh 3S 12C Lipo Pack w/XT60</a></li><li>Telemetry: <a href="./../telemetry/holybro_sik_radio.html">Holybro Transceiver Telemetry Radio V3</a></li><li>RC Receiver: <a href="https://www.banggood.com/FrSky-D4R-II-2_4G-4CH-ACCST-Telemetry-Receiver-for-RC-Drone-FPV-Racing-p-929069.html?cur_warehouse=GWTR" target="_blank" rel="noreferrer">FrSky D4R-II 2.4G 4CH ACCST Telemetry Receiver</a></li><li>Motors: <a href="https://www.amazon.com/DJI-E305-2312E-Motor-960kv/dp/B072MBMCZN" target="_blank" rel="noreferrer">DJI E305 2312E Motor (960kv,CW)</a></li><li>ESC: Hobbywing XRotor 20A APAC Brushless ESC 3-4S For RC Multicopters</li></ul><p>FrSky Taranis 조종기를 사용할 수 있습니다. 부수적으로 케이블 타이와, 양면 테이프, 납땜도 필요합니다.</p><p>아래의 이미지는 프레임과 전자 부품들을 나타냅니다.</p><p><img src="'+a+'" alt="All components used in this build"></p><h2 id="하드웨어" tabindex="-1">하드웨어 <a class="header-anchor" href="#하드웨어" aria-label="Permalink to &quot;하드웨어&quot;">​</a></h2><h3 id="프레임" tabindex="-1">프레임 <a class="header-anchor" href="#프레임" aria-label="Permalink to &quot;프레임&quot;">​</a></h3><p>이 절에서는 에어 프레임의 모든 하드웨어를 나열합니다.</p><table tabindex="0"><thead><tr><th>설명</th><th>수량</th></tr></thead><tbody><tr><td>DJI F450 밑판</td><td>1</td></tr><tr><td>DJI F450 윗판</td><td>1</td></tr><tr><td>DJI F450 랜딩기어 역할을 하는 다리</td><td>4</td></tr><tr><td>M3*8 나사</td><td>18</td></tr><tr><td>M2 5*6 나사</td><td>24</td></tr><tr><td>벨크로 배터리 스트랩</td><td>1</td></tr><tr><td>DJI Phantom 나사 내장 업그레이드 프로펠러 9.4x5</td><td>1</td></tr></tbody></table><p><img src="'+o+'" alt="F450 frame components"></p><h3 id="cuav-v5-nano-패키지" tabindex="-1">CUAV v5 nano 패키지 <a class="header-anchor" href="#cuav-v5-nano-패키지" aria-label="Permalink to &quot;CUAV v5 nano 패키지&quot;">​</a></h3><p>이 절에서는 CUAV v5 나노 구성 모음의 부품을 나열합니다.</p><table tabindex="0"><thead><tr><th>설명</th><th>수량 (기본 패키지)</th><th>수량 (+GPS 패키지)</th></tr></thead><tbody><tr><td>V5 nano 비행 제어기</td><td>1</td><td>1</td></tr><tr><td>듀퐁 케이블</td><td>2</td><td>2</td></tr><tr><td>I2C/CAN 케이블</td><td>2</td><td>2</td></tr><tr><td>ADC 6.6 케이블</td><td>2</td><td>2</td></tr><tr><td>SBUS 시그널 케이블</td><td>1</td><td>1</td></tr><tr><td>IRSSI 케이블</td><td>1</td><td>1</td></tr><tr><td>DSM 시그널 케이블</td><td>1</td><td>1</td></tr><tr><td>ADC 3.3 케이블</td><td>1</td><td>1</td></tr><tr><td>Debug 케이블</td><td>1</td><td>1</td></tr><tr><td>안전 스위치 케이블</td><td>1</td><td>1</td></tr><tr><td>Voltage &amp; Current Cable</td><td>1</td><td>1</td></tr><tr><td>PW-Link 모듈 케이블</td><td>1</td><td>1</td></tr><tr><td>전원 모듈</td><td>1</td><td>1</td></tr><tr><td>SanDisk 16GB 메모리 카드</td><td>1</td><td>1</td></tr><tr><td>I2C 확장 보드</td><td>1</td><td>1</td></tr><tr><td>TTL Plate</td><td>1</td><td>1</td></tr><tr><td>NEO GPS</td><td>-</td><td>1</td></tr><tr><td>GPS 브라켓</td><td>-</td><td>1</td></tr></tbody></table><h3 id="전자부품" tabindex="-1">전자부품 <a class="header-anchor" href="#전자부품" aria-label="Permalink to &quot;전자부품&quot;">​</a></h3><table tabindex="0"><thead><tr><th>설명</th><th>수량</th></tr></thead><tbody><tr><td>CUAV V5 nano</td><td>1</td></tr><tr><td>CUAV NEO V2 GPS</td><td>1</td></tr><tr><td>Holibro 텔레메트리</td><td>1</td></tr><tr><td>FrSky D4R-II 2.4G 4CH ACCST Telemetry Receiver</td><td>1</td></tr><tr><td>DJI E305 2312E Motor (800kv,CW)</td><td>4</td></tr><tr><td>Hobbywing XRotor 20A APAC Brushless ESC</td><td>4</td></tr><tr><td>전원모듈(CUAV V5 nano 패키지에 포함)</td><td>1</td></tr><tr><td>Turnigy 고용량 5200mAh 3S 12C Lipo Pack w/XT60</td><td>1</td></tr></tbody></table><h3 id="필요한-공구들" tabindex="-1">필요한 공구들 <a class="header-anchor" href="#필요한-공구들" aria-label="Permalink to &quot;필요한 공구들&quot;">​</a></h3><p>조립시에 필요한 공구들입니다.</p><ul><li>2.0mm 육각 스크류드라이버</li><li>3mm Phillips 스크류드라이버</li><li>전선 커터</li><li>정밀 트위저</li><li>납땜기</li></ul><p><img src="'+i+'" alt="Required tools"></p><h2 id="조립" tabindex="-1">조립 <a class="header-anchor" href="#조립" aria-label="Permalink to &quot;조립&quot;">​</a></h2><p>예상 조립 시간은 약 90분입니다 (프레임 조립에 약 45분, 자율비행프로그램 설치와 설정에 약 45분).</p><ol><li><p>제공된 나사를 이용하여 하판에 팔 4개를 결합합니다.</p><p><img src="'+l+'" alt="Arms to bottom plate"></p></li><li><p>ESC (변속기) 의 양극 (빨강)과 음극 (검정)을 보드에 납땜합니다.</p><p><img src="'+d+'" alt="Solder ESCs"></p></li><li><p>전원 모듈의 양극 (빨강)과 음극 (검정)을 납땜합니다.</p><p><img src="'+n+'" alt="Solder power module"></p></li><li><p>위치에 따라 모터를 ESC에 연결합니다.</p><p><img src="'+s+'" alt="Plug in motors"></p></li><li><p>각각의 모터를 해당하는 팔에 고정합니다.</p><p><img src="'+p+'" alt="Attach motors to arms (white)"><img src="'+m+'" alt="Attach motors to arms (red)"></p></li><li><p>(다리의 윗부분과 나사로 결합하여) 상판을 장착합니다.</p><p><img src="'+c+'" alt="Add top board"></p></li><li><p>Add damping foam to the <em>CUAV V5 nano</em> flight controller.</p><p><img src="'+h+'" alt="Damping foam"><img src="'+u+'" alt="Damping foam"></p></li><li><p>FrSky 수신기를 양면 테이프를 이용하여 하판에 부착합니다.</p><p><img src="'+f+'" alt="Attach FrSky receiver with double-sided tape"></p></li><li><p>텔레메트리 모듈을 기체의 아랫판에 양면테이프를 이용하여 부착합니다.</p><p><img src="'+g+'" alt="Attach telemetry radio"><img src="'+_+'" alt="Attach telemetry radio"></p></li><li><p>알루미늄 GPS 지지대를 밑판에 추가한후 GPS를 부착합니다.</p><p><img src="'+b+'" alt="Aluminium standoffs"></p></li><li><p>Plug in Telemetry (<code>TELEM1</code>), GPS module (<code>GPS/SAFETY</code>), RC receiver (<code>RC</code>), all 4 ESC’s (<code>M1-M4</code>), and the power module (<code>Power1</code>) into the flight controller. <img src="'+C+'" alt="Attach peripherals to flight controller"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The motor order is defined in the <a href="./../airframes/airframe_reference.html#quadrotor-x">Airframe Reference &gt; Quadrotor x</a></p></div></li></ol><p>:::</p><p>끝났습니다! 마지막 조립순서가 다음에 이어집니다:</p><p><img src="'+e+'" alt="Finished Setup"></p><h2 id="px4-설정" tabindex="-1">PX4 설정 <a class="header-anchor" href="#px4-설정" aria-label="Permalink to &quot;PX4 설정&quot;">​</a></h2><p><em>QGroundControl</em> is used to install the PX4 autopilot and configure/tune it for the frame. <a href="http://qgroundcontrol.com/downloads/" target="_blank" rel="noreferrer">Download and install</a> <em>QGroundControl</em> for your platform.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Full instructions for installing and configuring PX4 can be found in <a href="./../config/">Basic Configuration</a>.</p></div><p>First update the firmware, airframe, geometry and outputs:</p><ul><li><p><a href="./../config/firmware.html">Firmware</a></p></li><li><p><a href="./../config/airframe.html">Airframe</a></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>You will need to select the <em>Generic Quadcopter</em> airframe (<strong>Quadrotor x &gt; Generic Quadcopter</strong>).</p><p><img src="'+k+'" alt="QGroundControl - Select Generic Quadcopter"></p></div></li></ul><p>:::</p><ul><li><a href="./../config/actuators.html">Actuators</a><ul><li>Update the vehicle geometry to match the frame.</li><li>Assign actuator functions to outputs to match your wiring.</li><li>Test the configuration using the sliders.</li></ul></li></ul><p>그리고, 설치후에 필수적인 설정 작업과 보정 작업을 진행하여야 합니다.</p><ul><li><p><a href="./../config/flight_controller_orientation.html">Sensor Orientation</a></p></li><li><p><a href="./../config/compass.html">Compass</a></p></li><li><p><a href="./../config/accelerometer.html">Accelerometer</a></p></li><li><p><a href="./../config/level_horizon_calibration.html">Level Horizon Calibration</a></p></li><li><p><a href="./../config/radio.html">Radio Setup</a></p></li><li><p><a href="./../config/flight_mode.html">Flight Modes</a></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>For this build we set up modes <em>Stabilized</em>, <em>Altitude</em> and <em>Position</em> on a three-way switch on the receiver (mapped to a single channel - 5). 이 방법이 초심자에게 추천하는 최소 설정입니다.</p></div></li></ul><p>:::</p><p>이후 다음 작업 역시 수행되어야 합니다:</p><ul><li><a href="./../advanced_config/esc_calibration.html">ESC Calibration</a></li><li><a href="./../config/battery.html">Battery Estimation Tuning</a></li><li><a href="./../config/safety.html">Safety</a></li></ul><h2 id="튜닝" tabindex="-1">튜닝 <a class="header-anchor" href="#튜닝" aria-label="Permalink to &quot;튜닝&quot;">​</a></h2><p>Airframe selection sets <em>default</em> autopilot parameters for the frame. These may be good enough to fly with, but you should tune each frame build.</p><p>For instructions on how, start from <a href="./../config/autotune_mc.html">Autotune</a>.</p><h2 id="비디오" tabindex="-1">비디오 <a class="header-anchor" href="#비디오" aria-label="Permalink to &quot;비디오&quot;">​</a></h2>',47),t("lite-youtube",{videoid:"b0bKNdDqVHw",title:"CUAV Nano"},null,-1),t("h2",{id:"감사의-글",tabindex:"-1"},[y("감사의 글 "),t("a",{class:"header-anchor",href:"#감사의-글","aria-label":'Permalink to "감사의 글"'},"​")],-1),t("p",null,"이 빌드 로그는 Dronecode Test Flight Team에서 제공했습니다.",-1)]))}const R=v(w,[["render",F]]);export{G as __pageData,R as default};
